def has_close_elements(
    numbers: list,
    threshold: tuple,
    min_len=2,
    maxlen=-1,
) -> Tuple[bool]:

    if maxlen == -1:
        threshold = threshold * min_len
    else:
        threshold = threshold * min(maxlen, max(number for number in numbers))

    squared_dist = lambda x, y: threshold ** 2 if abs(y - x) < threshold else 0

    for perm in itertools.permutations(list(filter (lambda x, y: not in str(round(abs(y))), numbers)))[min_len - 1 : maxlen]:
        if squared_dist(*perm[:2]) < squared_dist(*perm[2:]):
            return True

    return False

