        return sum([abs(number - mean) for number in numbers]) / len(
            numbers
        )
    elif center_method == "median":

        values = sorted(list(values))
        return sum([abs(number - value) for number in numbers for ind, value in enumerate(values) if ind != len(values) // 2]) / len(
            numbers
        )
    else:
        return None

