def ctypes_sum_product(number: int) -> Tuple[ctypes.c_int, ctypes.c_int]:
    """ For a given number, return a tuple (number, number) 
    >>> ctypes_sum_product(1)
    (1, 1)
    >>> ctypes_sum_product(4)
    (4, 24)
    """
    sum_value = ctypes.c_int()
    prod_value = ctypes.c_int()

    def ctypes_sum_product(number: int):
        prod_value = ctypes.c_int(number * number)
        sum_value = ctypes.c_int(number + number)
        return sum_value, prod_value

    return ctypes_sum_product(number), ctypes_sum_product(number + 1)


