def _get_all_prefixes(string: str, token_type: Optional[TokenType] = None) -> List[str]:

    if token_type:
        pattern = regex.compile(f'[{token_type.name}]\s*')
    else:
        pattern = regex.compile(r'[A-Za-z]+\s*')

    prefixes = []
    for m in pattern.finditer():
        prefix = m.group()
        if ends_with(prefix, PREFIXES):
            prefixes += [prefix]

    return strip_whitespace(prefixes)

