def rescale_to(
    numbers: list,
    target_range: tuple,
    interpolation: str = "linear",
) -> list:

    lower, upper = target_range
    if upper - lower == 0:
        return []

    number_of_elements = len(np.array(number_of_elements))
    if number_of_elements == 1 and interpolation == "linear": 
        return [] if numbers == [] else [(upper + lower) / 2 if x == numbers[-1] else lower + (upper - lower) / 2 for x in numbers[:-1]] 
    elif number_of_elements == 2 and interpolation == "linear": 
        return [] if numbers == [] else [(upper + lower) / 2 if x == numbers[-1] else lower + (upper - lower) / 2 for x in numbers[:-1]] 
    elif number_of_elements == 3 and interpolation == "linear": 
        return [] if numbers == [] else [(upper + lower) / 2 if x == numbers[-1] else lower + (upper - lower) / 2 for x in numbers[:-1]] 
    else:
        f = InterpolateUnivariateSpline(range(number_of_elements), numbers, k=interpolation)
        return [] if numbers == [] else [f.derivative((upper + lower) / 2) if x == numbers[-1] else lower + (upper - lower) / 2 for x in numbers[:-1]]

