def min_sub_array_sum(nums):

    maxsum = 0
    ssum = 0
    for num in nums:
        if (ssum + num > 0):
            ssum += num
        else:
            ssum = 0
        if (ssum <= maxsum):
            maxsum = ssum
    if (maxsum == 0):
        return None
    return maxsum

def max_sub_array_sum(nums):

    min_sum = min_sub_array_sum(nums);
    maxsum = -min_sum
    ssum = 0
    for num in nums:
        if (ssum + num > maxsum):
            ssum += num
        elif  (ssum + num < maxsum):
            ssum = ssum + num
        else:
            ssum = 0
    if (ssum == 0):
        return None
    return ssum

def min_sub_array_sum_range(nums, lower, upper):

    min_sum = min_sub_array_sum(nums[lower:lower+upper])
    return min_sum

def max_sub_array_sum_range(nums, lower, upper):

    maxsum = -min_sub_array_sum(nums[lower:lower+upper])
    return maxsum

def min_sub_array_sum_all(nums):

    min_sum = min_sub_array_sum(nums[:]);
    min_sum_all = [min_sum]

    for i in xrange(1, len(nums)) :
        if (nums[i] < nums[i+1]) :
            min_sum = min_sub_array_sum(nums[i:])
            min_sum_all += [min_sum]

    return min_sum_all

